import axios from 'axios';


interface SignUpInfo {
    emailAddress: string;
    userPassword: string;
    fullName: string;
    university: number;
    course: string;
    yearOfStudy: number;
}


const signUp = (value: SignUpInfo) => {
    console.log("Service received");
    axios({
        method: 'post',
        url: '/user',
        baseURL: 'http://localhost:8080/api',
        data : {
            email : value.emailAddress,
            password: value.userPassword,
            name: value.fullName,
            schoolId: value.university,
            courseId: value.course,
            currentYear: value.yearOfStudy,
        }
    }).then(function(response) {
        console.log(response);
    }).catch(function(error) {
        console.log(error);
    })
}

export default {
    signUp
}
